function Yourname(props){
    const month = props.date.toLocaleString('es-US', {month:'long'});
    const day = props.date.toLocaleString('es-US', {day:'2-digit'});
    const year = props.date.getFullYear();



    return (
        <div>
            <div>{month}</div>
            <div>{day}</div>
            <div>{year}</div>
        </div>
    )

}
export default Yourname;
